def calculate_minimum_problems(c: int, d: int, n: int, m: int, k: int) -> int:
    dp = [0] / 100000
    need = n * m - k
    if need <= 0:
        return 0
    for i in range(1, 100000):
        dp[i] = min(dp[i - n] + c, dp[i - 1] + d)
    return dp[need]

